            console.log([{ a: 2 }] === [{ a: 2 }], `[{a: 2}]===[{a: 2}], console 13`)
            console.log([{ a: 2 }] === [{ a: 2 }], `[{a: 2}]===[{a: 2}], console 14`)
            console.log([2] == 2, "[2]==2 console 15")
            console.log([2] === 2, "[2]===2 console 16")
            console.log([2] == "2", `[2]=="2" console 17`)
            console.log([2] === "2", `[2]==="2" console 18`)
            console.log(0 == -0, "0 == -0, console 19")
            console.log(0 === -0, "0 === -0, console 20")
            console.log(null == 0, "null == 0, console 21")
            console.log(null === 0, "null===0, console 22")
            console.log(undefined == 0, "undefined == 0, console 23")
        }
    }, [])

    return (
        <div>
            kumar Madhu
